      subroutine GetKernelValue(D,delta,phi,DPhiD1,DPhiD2)
    !  use constants
      implicit none
      double precision D,delta,phi,DPhiD1,DPhiD2
       
      integer khi1,klo1,khi2,klo2,k
      double precision h1,h2,aa1,bb1,cc1,dd1,aa2,bb2,cc2,dd2,D2
      double precision overh1,overh2,over6
      double precision C,t,sgn
      parameter (C=-3*pii**2*(4*pii/9)**3)
      parameter (over6=1d0/6d0)

