         dd1=(bb1**3-bb1)*h1**2*over6

         aa2=(DeltaList(khi2)-delta)*overh2
         bb2=(delta-DeltaList(klo2))*overh2
         cc2=(aa2**3-aa2)*h2**2*over6
         dd2=(bb2**3-bb2)*h2**2*over6

         phi=    cc1*(aa2*der1tab(klo1,klo2)+bb2*der1tab(klo1,khi2))
         phi=phi+dd1*(aa2*der1tab(khi1,klo2)+bb2*der1tab(khi1,khi2))
         phi=phi+cc2*(aa1*der2tab(klo1,klo2)+bb1*der2tab(khi1,klo2))
         phi=phi+dd2*(aa1*der2tab(klo1,khi2)+bb1*der2tab(khi1,khi2))
         phi=phi+aa1*(aa2*KernelTable(klo1,klo2)+bb2*KernelTable(klo1,khi2))
         phi=phi+bb1*(aa2*KernelTable(khi1,klo2)+bb2*KernelTable(khi1,khi2))

         phi=phi*D2

         DPhiD1=aa2*(KernelTable(khi1,klo2)-KernelTable(klo1,klo2))*overh1
         DPhiD1=DPhiD1+bb2*(KernelTable(khi1,khi2)-KernelTable(klo1,khi2))*overh1
         DPhiD1=DPhiD1-(3d0*aa1**2-1d0)*(aa2*der1tab(klo1,klo2)+bb2*der1tab(klo1,khi2))*over6*h1
         DPhiD1=DPhiD1+(3d0*bb1**2-1d0)*(aa2*der1tab(khi1,klo2)+bb2*der1tab(khi1,khi2))*over6*h1
         DPhiD1=DPhiD1+cc2*(der2tab(khi1,klo2)-der2tab(klo1,klo2))*overh1
         DPhiD1=DPhiD1+dd2*(der2tab(khi1,khi2)-der2tab(klo1,khi2))*overh1

         DPhiD1=(DPhiD1-2*D*phi)*D2

         DPhiD2=aa1*(KernelTable(klo1,khi2)-KernelTable(klo1,klo2))*overh2
         DPhiD2=DPhiD2+bb1*(KernelTable(khi1,khi2)-KernelTable(khi1,klo2))*overh2
         DPhiD2=DPhiD2-(3d0*aa2**2-1d0)*(aa1*der2tab(klo1,klo2)+bb1*der2tab(khi1,klo2))*over6*h2
         DPhiD2=DPhiD2+(3d0*bb2**2-1d0)*(aa1*der2tab(klo1,khi2)+bb1*der2tab(khi1,khi2))*over6*h2
         DPhiD2=DPhiD2+cc1*(der1tab(klo1,khi2)-der1tab(klo1,klo2))*overh2
         DPhiD2=DPhiD2+dd1*(der1tab(khi1,khi2)-der1tab(khi1,klo2))*overh2

         DPhiD2=sgn*DPhiD2*D2
       else
          phi=0
          DPhiD1=0
          DPhiD2=0
!         D2=D*D
!         t=delta*delta
!         phi=C/(D2**3*(1-t)**2*(1+t))
!         DPhiD1=-6_dp*phi/D
!         DPhiD2=sgn*phi*2_dp*delta*(1_dp+3_dp*t)/(1-t**2)
       endif

      end subroutine GetKernelValue


      subroutine RemoveKernelFromMemory
     ! use constants
      deallocate(DList,DeltaList,KernelTable)
      deallocate(der1tab,der2tab)
      end subroutine RemoveKernelFromMemory
      SUBROUTINE spline(x,y,n,yp1,ypn,y2)
    !  use constants
      implicit none
      INTEGER n,NMAX
      double precision yp1,ypn,x(n),y(n),y2(n)
      PARAMETER (NMAX=4000)
      INTEGER i,k
      double precision p,qn,sig,un,u(NMAX)
      if (yp1.gt..99e30) then
         y2(1)=0.
         u(1)=0.
      else
         y2(1)=-0.5
         u(1)=(3./(x(2)-x(1)))*((y(2)-y(1))/(x(2)-x(1))-yp1)
      endif
      do i=2,n-1
         sig=(x(i)-x(i-1))/(x(i+1)-x(i-1))
         p=sig*y2(i-1)+2.
         y2(i)=(sig-1.)/p
         u(i)=(6.*((y(i+1)-y(i))/(x(i+1)-x(i))-(y(i)-y(i-1))/(x(i)-x(i-1)))/(x(i+1)-x(i-1))-sig*u(i-1))/p
      enddo
      if (ypn.gt..99e30) then
         qn=0.
         un=0.
      else
         qn=0.5
         un=(3./(x(n)-x(n-1)))*(ypn-(y(n)-y(n-1))/(x(n)-x(n-1)))
      endif
      y2(n)=(un-qn*u(n-1))/(qn*y2(n-1)+1.)
      do k=n-1,1,-1
         y2(k)=y2(k)*y2(k+1)+u(k)
      enddo
      return
      end subroutine spline
      END MODULE


